import React, { useState, useCallback, useEffect } from 'react';
import ReactFlow, { 
  MiniMap, 
  Controls, 
  Background, 
  useNodesState, 
  useEdgesState
} from 'react-flow-renderer';
import nodeTypes from './nodeTypes';
import './App.css';

const API_BASE_URL = 'http://localhost:3001/api';

function App() {
  const [allGroups, setAllGroups] = useState([]);
  const [selectedGroup, setSelectedGroup] = useState(null);
  const [nodes, setNodes, onNodesChange] = useNodesState([]);
  const [edges, setEdges, onEdgesChange] = useEdgesState([]);
  const [selectedNode, setSelectedNode] = useState(null);

  useEffect(() => {
    fetchAllGroups();
  }, []);

  const fetchAllGroups = async () => {
    try {
      const response = await fetch(`${API_BASE_URL}/groups`);
      const data = await response.json();
      setAllGroups(Array.isArray(data) ? data : []);
    } catch (error) {
      console.error('Failed to fetch all groups:', error);
    }
  };

  const handleGroupSelect = useCallback(async (groupId) => {
    setSelectedGroup(groupId);
    try {
      const response = await fetch(`${API_BASE_URL}/groups/${groupId}/graph`);
      const graph = await response.json();

      console.log('Received graph data:', graph);  // Debug log

      const newNodes = graph.nodes.map(node => ({
        ...node,
        position: getInitialNodePosition(node.type),
      }));

      const newEdges = graph.edges.map(edge => ({
        ...edge,
        type: 'smoothstep',
        animated: true,
        style: { stroke: '#888' },
      }));

      console.log('Processed nodes:', newNodes);  // Debug log
      console.log('Processed edges:', newEdges);  // Debug log

      setNodes(newNodes);
      setEdges(newEdges);
    } catch (error) {
      console.error('Failed to fetch group data:', error);
    }
  }, [setNodes, setEdges]);

  const getInitialNodePosition = (type) => {
    const centerX = 250;
    const centerY = 250;
    const radius = 200;
    const angle = Math.random() * 2 * Math.PI;

    switch(type) {
      case 'Customer':
        return { x: centerX + radius * Math.cos(angle), y: centerY + radius * Math.sin(angle) };
      case 'Counter-Party':
        return { x: centerX + radius * 0.8 * Math.cos(angle + Math.PI), y: centerY + radius * 0.8 * Math.sin(angle + Math.PI) };
      case 'Business':
        return { x: centerX + radius * 0.6 * Math.cos(angle + Math.PI/2), y: centerY + radius * 0.6 * Math.sin(angle + Math.PI/2) };
      case 'Transfer':
      case 'BillPay':
        return { x: centerX + radius * 0.4 * Math.cos(angle), y: centerY + radius * 0.4 * Math.sin(angle) };
      default:
        return { x: centerX + radius * Math.random(), y: centerY + radius * Math.random() };
    }
  };

  const onNodeClick = useCallback((event, node) => {
    setSelectedNode(node);
  }, []);

  return (
    <div className="app-container">
      <header className="app-header">
        <h1>Entity Resolution System</h1>
      </header>
      <div className="app-content">
        <div className="search-panel">
          <h2>Groups</h2>
          {allGroups.map(groupId => (
            <div 
              key={groupId} 
              onClick={() => handleGroupSelect(groupId)} 
              className={`group-item ${selectedGroup === groupId ? 'selected' : ''}`}
            >
              {groupId}
            </div>
          ))}
        </div>
        <div className="visualization-panel">
          {nodes.length > 0 ? (
            <ReactFlow 
              nodes={nodes}
              edges={edges}
              onNodesChange={onNodesChange}
              onEdgesChange={onEdgesChange}
              nodeTypes={nodeTypes}
              onNodeClick={onNodeClick}
              fitView
              style={{ width: '100%', height: '600px' }}
            >
              <MiniMap />
              <Controls />
              <Background color="#aaa" gap={16} />
            </ReactFlow>
          ) : (
            <p>Select a group to view its visualization</p>
          )}
        </div>
        <div className="details-panel">
          {selectedNode ? (
            <div>
              <h2>{selectedNode.type}: {selectedNode.id}</h2>
              <pre>{JSON.stringify(selectedNode.data, null, 2)}</pre>
            </div>
          ) : (
            <p>Select a node to view details</p>
          )}
        </div>
      </div>
    </div>
  );
}

export default App;
